import React from "react"


import "./homepage.css"
import Header from "../header/header";
import Footer from "../Footer/footer";

const Homepage = ({setLoginUser}) => {
    return (
        <div className="Homepage">
        <Header />
        <div className="Main">
        <h1>Welcome To Home Page</h1>
      
</div>
<Footer/>
        </div>
    )
}

export default Homepage
